import React from 'react';
import DetailBox from '../../components/DetailBox';
import pointsIcon from '../../assets/pointsIcon.png';
import rewardsIcon from '../../assets/rewardsIcon.png';
import requestIcon from '../../assets/requestIcon.png';
import orderIcon from '../../assets/orderIcon.png';
import "./Dashboard.css";

export default function Dashboard() {
  return(
    <div>

  <div id="main">
    <h2>Dashboard</h2>
    <div class="detail-summary">
    <DetailBox logo={pointsIcon} text= "Total Points" onClick={()=> {this.phistory.push("/points")}}/>
    <DetailBox logo={rewardsIcon} text="Points to Redeem" onClick={()=>{this.redeemPoints() }} />
    <DetailBox logo={requestIcon} text="Pending Requests" onClick={()=>{this.myrequests() }} />
    <DetailBox logo={orderIcon} text="Pending Orders" onClick={()=>{this.myorders() }} />
    </div>
  </div>
    </div>

  );

}
